update futureinfo set (DELIVERYYEAR,LASTTRDDATE,MATUREDATE,LASTSETTLEDATE,DELIVERYDATE)=(select to_char(to_number(substr(tradedate,1,4))+1),replace(LASTTRDDATE,'2022',to_char(to_number(substr(tradedate,1,4))+1)),replace(MATUREDATE,'2022',to_char(to_number(substr(tradedate,1,4))+1)),replace(LASTSETTLEDATE,'2022',to_char(to_number(substr(tradedate,1,4))+1)),replace(DELIVERYDATE,'2022',to_char(to_number(substr(tradedate,1,4))+1)) from  sysconfig) where   exchid='X' and stkid in('10002833','10002845','10002851','10002846','10003975','10003984','10003976','10003985');
update futureinfo set (DELIVERYYEAR,LASTTRDDATE,MATUREDATE,LASTSETTLEDATE,DELIVERYDATE)=(select substr(tradedate,1,4),tradedate,tradedate,tradedate,tradedate from  sysconfig) where   exchid='Y' and stkid in('10003977','10003986','10003978','10003987');
